const Reducers = (state = "All Category", action) => {
  switch (action.type) {
    case "men's clothing":
      return (action.payload = "men's clothing");

    case "jewelery":
      return (action.payload = "jewelery");
    case "electronics":
      return (action.payload = "electronics");
    case "women's clothing":
      return (action.payload = "women's clothing");
    default:
      return state;
  }
};
export default Reducers;
